2	How I built this website (Backend)	2021-04-05 00:00:00	\\	<p>Building this website stemmed from me needing to learn web technologies for my first job outside varsity. When it comes to learning a new software I typically need to build something with the technology for me to feel comfortable with it. Similarly it was for learning Angular, ASP.NET and PostgreSQL which were used to build this website. Despite my initial adversion to using tools that don't feel paritculary close to hardware, I found this experiance tremendously valuable to finally build a website.</p>\n<h2 id="the-software-stack">The Software Stack</h2>\n<p>Angular : Framework to build the web application which will run on the client's machine (i.e. their browser) ASP.NET : Used to build the software running on the server. Typically the client requests information from the server such as content of the blog post to be loaded. PostgreSQL : Database tool to store information. In the case of this website information stored mainly relates to the blog entries. (e.g. storing the title, body and thumbnail of the blog post).</p>\n<h2 id="brief-intro-to-n-tier-apps">Brief Intro to N-Tier Apps</h2>\n<p>Software, especially in business, is almost always done with teams of developers. Software is only getting more complicated and with each developer producing hundreds of lines of code a day each addressing a differents problems. It is easy to see how this will become difficult to manage. N-Tier applications is a software design principle to seperate the different &quot;concerns&quot; of an application. We already see a bit of this separation in using the Angular framework for the client app and different ASP.NET framework for the server application.</p>\n<p>In the of the server application we can further divide the objectives into these categories:</p>\n<ul>\n<li>Core layer application which defines the classes which you will use to model &quot;business logic.&quot; For instance a banking website deals with transactions everyday and a single transaction can be modelled as an object with sender, reciever, amount and timestamp properties.</li>\n<li>EntityFramework layer application which is responsible for managing everything related to the database access</li>\n<li>The Web Host. This is the &quot;main&quot; component of the application.</li>\n</ul>\n<p><img scr="./NTierStack.png"></p>\n<h2 id="getting-started">Getting started</h2>\n<p>With all of that out the way, let me walk you through the steps I took to build this website. These are summarized as follows. Running the dotnet command will produce an empty Angular and ASP.NET application for you.</p>\n<ol style="list-style-type: decimal">\n<li>Separate the concerns of the application by creating and referencing new dotnet class projects</li>\n<li>Model the objects you will be storing in the database</li>\n<li>Define a database context which bridges the database and your code</li>\n<li>Seed and manage your database with dotnet entityframework</li>\n<li>Define a controller which will communicate to the client side application</li>\n<li>Build your client side application (we leaving the best for last)</li>\n</ol>\n<h3 id="separating-concerns">Separating Concerns</h3>\n<p>Let's first create an folder which will store the all the components of the website in it's entirety. Each layer of project will have a different namespace to help organize the code. Each layer can be created with a dotnet library class. The projects will then need to be linked so that they are <em>aware</em> of each other and the compiler knows where to find the different components used. This is done by running the following command from your Web.Host layer to reference every other project layer.</p>\n<pre><code>dotnet new classlib -o &lt;layer_name&gt;\ncd &lt;layer_name&gt;\ndotnet add &lt;this_project.csprj&gt; reference &lt;other_project.csprj&gt;</code></pre>\n<h3 id="modelling-the-business-logic">Modelling the business logic</h3>\n<p>This website isn't a real business application but we are in the business of displaying blog posts. Let's model a BlogEntry as a class with title, content, date modified, thumbnail image properties. I defined type for the title, content and thumbnail image as strings whereas the data modified field is a C# DateTime type. This website is as simple as it gets and that is all we'll do for the domain logic. This class will be used as a blueprint for defining the database in which we will store the blog entries. The design process of defining the code before creating the database intiuitvely referred to as <strong>code first</strong> approach.</p>\n<h3 id="defining-the-dbcontext">Defining the DBContext</h3>\n<p>Arguably this and the next steps are the hardest to get right. It was uncomfortable for me to try make my code leave the safe bounds of its own folder to try find and connect to something that exists someplace I do not know. However after one or two practice applications the procedure becomes quite straight forward. Dotnet automates a large amount of database management with it's EntityFramework and hence all code working with the database will naturally be done in the EntityFramework layer. First consider which database you will ne using. I am working with PostgresSQL database and thus I needed to include Npsql package.</p>\n<pre><code>dotnet add package Npgsql --version 5.0.4</code></pre>\n<pre><code>public class BlogDbContext : DbContext {\n\n        public DbSet&lt;BlogEntry&gt; BlogEntries { get; set; }\n\n        public BlogDbContext(DbContextOptions&lt;BlogDbContext&gt; options) : base(options){}\n\n        protected override void OnModelCreating(ModelBuilder modelBuilder){\n                modelBuilder.Entity&lt;BlogEntry&gt;().ToTable(&quot;BlogEntries&quot;);\n        }\n}</code></pre>\n<p>Optional: It is possible to <em>seed</em> the database when it is being created for the first time (i.e. add some initial records to the tables). This is accomplished by creating a DBInit class and Init method which is called in the Program.cs file.</p>\n<p>Disclaimer: <em>This website was a learning exercise for me and thus the sole reason for using a database is for learning purposes. Typically for a blog website serving mostly static content, such as blog posts, it is arguablly better to use ASP.NET's static page features instead.</em></p>\n<h3 id="setting-up-database-connection-and-first-database-migration">Setting up Database Connection and First Database Migration</h3>\n<p>You need to the correct creditials and point your app to where to find and access the database. This is all done in the appsettings.json file in *.Web.Host project folder.</p>\n<p>Now that the app knows how to access your database you can return to the *.EntityFramework folder and run our first <em>migration</em>. Databases migrations are like Git version control for databases. They allow other developers to quickly replicate your database setup on their machines. Cosnider databases play a critical role in modern web applications and the application code is written to target the defined database structure. What would happen if we needed to change the structure of the database later (e.g. add an additional column). Not only would the database be altered but also all the code that interacts with that database. Hopefully that illustrates the need to bundle both database changes and code changes.</p>\n<pre><code>dotnet ef migrations add Initial\ndotnet ef database update</code></pre>\n<h3 id="creating-the-controller">Creating the Controller</h3>\n<p>The Angular front end application will request a specific blog post from the server. The server will then fetch the requested blog post from the database and serve it to the front end application. This functionality is realised with the controller.</p>\n<h3 id="run-your-application">Run your application</h3>\n<pre><code>dotnet run</code></pre>\n<h2 id="bonus-containerize-your-application">Bonus: Containerize your Application</h2>\n<h3 id="brief-intro-to-docker-and-containers">Brief Intro to Docker and Containers</h3>\n<p>Often times you install some new and exciting application, you are required to also install all it's dependancies. The world of software however is ever changing with new updates and developments occuring daily. This is a problem when trying to build your own application which would targets your specific setup. Containers solve this problem by allowing users to download not only your application but also a specific &quot;snapshot&quot; of your development environment. Container's begin with some base image which you can use to build your container off of. Think of a base image as a fresh install of some Linux operating system.</p>\n<p>Container technology is useful for collaboration as now everyone has a standardized development environment.</p>\n<h3 id="example-dockerfile">Example Dockerfile</h3>\n<p>Containerizing your application is as simple as creating a Dockerfile in your project's directory, specifying with base image you want you use, copying all your project files to the container and then running the container. I am using an example <a href="https://docs.docker.com/samples/dotnetcore/">Dockerfile</a> provided by Docker's documentation.</p>\n	https://unsplash.com/photos/tZc3vjPCk-Q
1	Things I learnt about bonds	2021-04-05 00:00:00	\\	<p>A = OE + L</p>\n<p>Remember this equation? From sometime back in Grade 9 accounting. It is the accounting equation and states that the assets of a business is equal to the sum of the business' owners' equity and liabilities. Here are some examples in action.</p>\n<p>Say a business takes out a loan, the bank account of the business will increase with the new found money however, since the business still needs to eventually return the money, their liabilities must also increase. Alternatively if the business sells some of it's inventory (assets) at a profit that profit now belongs to the owner and hence the company's bank account and owner's equity increases. Perhaps if we rearranged the equation as follows, it would be insultingly obvious that whatever assets are left after paying back all liabilities is owed to the owner.</p>\n<p>OE = A - L</p>\n<p>With that out the way, we can see there are two ways a company can raise money (asset) to do business-y things. Either the business needs to sell more shares or the business takes out a loan. Raising money buying shares is typically more fimiliar. Although I wouldn't say is necessarily true if you are purchasing a share from someone else. That share is just trading hands and not necessarily generating new capital...but I digress. What company can do is take a loan from the people like you and me. We loan money to the company for a fixed amount of time and that company will agree to pay us back with interest. This is a bond contract. This is somewhat analogous to saving money in the bank through a savings account or fixed deposit. We'll tackle the question of which one is better after some quick observations.</p>\n<h2 id="rapid-fire-observations">Rapid Fire Observations</h2>\n<ul>\n<li>Bonds are safer investments than since if a business is goes bankrupt, they are obliged to pay their debt off first before paying off before the shareholders can claim anything</li>\n<li>Bonds are issued with an agreed upon yeild</li>\n<li>After entering a bond contract, you will only get your money back after the agreed upon date. This is referred to as maturity. If you want your money back sooner, you have the option of selling the bond to someone else.</li>\n<li>If the person you sold the bond to is a sucker they might pay more than the price of the bond and expected interest. This is selling a bond at a premium. Alternatively if you're desparate to get back your money now you may have to sell your bond at a discount forfeiting expected returns.</li>\n<li>I have not been able to find a stockbroker that'll allow you to buy individual bonds directly on the JSE debt market. However you can buy government bonds <a href="retailbonds.co.za">here</a>.</li>\n<li>You can buy government bonds that have inflation linked interest rates.</li>\n<li>Alternatively you can buy Bond ETFs (a collection of bonds that can be bought and traded like shares). Examples of these include: 1. SATRIX Government Bonds 2. SATRIX Inflation Linked Bonds</li>\n</ul>\n<h2 id="relationship-between-interests-rates-and-bond-prices">Relationship between Interests Rates and Bond Prices</h2>\n<p>Banks offer interest rates on their savings accounts, money market accounts (what are these?) and fixed deposits are rates somewhat similar to that of the repo rate. The repo rate is set by the government and details of which are way beyond me. Anyway say someone agreed to a bond 3 years ago at 10% maturing in a year. Now let's say the banks are going to decrease the interest rate of your savings account from 10% to 5%. Wouldn't you rather be earning the 10%? If that is the case more and more people would be willing to buy the bond therefore increasing it's price. Conversely if the interest rates at the bank increase, most would rather get a better return with the bank than waste time with the bond. Thereby decreasing bond prices. This brings us to the saying:</p>\n<p>&quot;bond prices decrease with increasing interest rates and vice versa&quot;</p>\n<h2 id="bonds-vs-shares">Bonds vs Shares</h2>\n<p>Typically shares produce higher returns over time. This would be expected since ownership in a company is greater risk than just lending money to them. Benjamin Graham offers the advice of keeping a 50/50 split between bonds and shares. This ratio is to be adjusted depending on how long you want your money to be invested. If you in for the long run, then more shares and less bonds otherwise for short term-investing more bonds less shares.</p>\n<p>With higher expected returns for shares over time why not just go all in for shares? This is a good idea however the stock market can sometimes some really scary periods where none of your shares are in the postive. Bonds are more typically stable and having some around when during the rough periods may allow you to sleep better at night.</p>	https://www.freeimages.com/photo/handshake-communication-1532849
3	Exploring WebAssembly	2021-04-03 22:04:00	\\	<p>WebAssembly is a relatively new technology which offers machine native speeds for web applications. Web applications because of their ubiquity in our everyday lives offer a form of virtualization as they are able to run on any machine that can run a browser. It is easy to understand the benefits of virtualization for developers since once you write a web app once you can deploy it to any machine running a browser regardless of what operating system the user is running. This is similar to the goal of Docker and containerization, which offered developers a way to package their application in its own container with its own operating system and dependencies and have it run on any machine with a docker runtime. The interests between both Docker and WebAssembly are so similar that even Dockers co-creator, Solomon Hykes, said If WASM+WASI existed in 2008, we wouldnt have needed to create Docker. I have used Docker for multiple projects and come to fairly understand the benefits it provides. But now I am interested to see if and how WebAssembly can really be a substitute for Docker. The benefits of WebAssembly doesn't end with running code in the browser. I learnt it was initially designed as a way to compile non-web languages such as C or C++ to Javascript, opening up the possibility of using libraries written in other languages to be included in your web app. No more effort lost on searching for Javascript alternatives or writing complex wrappers. Lets write a basic hello world program in WebAssembly</p>\n	https://commons.wikimedia.org/wiki/File:WebAssembly_Logo.svg
4	Identifying my biases and logical fallacies	2021-04-10 15:04:00	\\	<p>During my third year at varsity, I elected to do a course in business ethics. The course was taught by the phiopshy department. I am extremely glad that I had taken as it formally introduced me to logical reasoning and cognitive biases. I geniunly think that identifying these logical shortfalls will hopefully make me a better decision maker. In this post I will address some of the fallicies and biases that I think I most often fall prey to.</p>\n<h3 id="appeal-to-hypocrisiy">1. Appeal to Hypocrisiy</h3>\n<p>This is fallacy occurs if I dismiss an argument because the person who is stating lives a life different to the point they're trying to make. As an example, I may dismiss a smoker who is arguing that smoking is unhealthy. This example however illustrates that we can engage with a hypocrite because despite them not living in accordance to their stated arguments does not mean the arguments themselves are any less valid.</p>\n<h3 id="appeal-to-authority">2. Appeal to Authority</h3>\n<p>It always feels good when someone agrees with your beliefs. It feels even better when those people are accomplished and successful. However again believing something just because the someone else said it is the easy way out in logical thinking. I need to be reminded that we responisbility is on us to make sense of the world than just to relying on the views of accomplished individuals or even the general population (this is instead referred to as an ad populum fallacy). Of course it is impossible to learn the facts of every single area of study and draw your own conclusions on every single issue. In those cases it is best to defer to the expert but probably should also mean you abstain from hottly debating such issues.</p>\n<h3 id="berksons-paradox">3. Berkson's Paradox</h3>\n<p>I really like this war story of an army trying to figure out where to reinforce their aircraft after battle. Iniitially they decided to reinforce the areas of the planes which were most riddled with bullet holes. It is was a mathematician who stopped them and decided to reinforce the areas which hardly had any bullet holes. This was because the army had collected their data from the planes had had arrived back and didn't take into account that there were planes that didn't. These planes were able arrive back with bullet holes in thoe areas meaning those areas were less critical to plane function. So the moral of this story is when interpreting statistical results, always consider the indirect assumptions you are making with your sample population.</p>\n<h3 id="confirmation-bias">4. Confirmation bias</h3>\n<p>Like I've mentioned earlier it is always feels great to listen to people who share the same outlook as you. Google and YouTube knows this and feeds you information that most closely fits your world view. This is probably a good reason to protect your privacy and avoid companies from tracking you, but I digress. An example of me falling to confirmation bias is whilst I continue to learn about cryptocurrencies and all their contraversies, I would prefer watching videos that are in-line with my initial opinion. When I catch myself doing this I try challenge watching a video that is opposite to what I think, however uncomfortable it my be.</p>	https://unsplash.com/photos/nLXOatvTaLo
5	Exploring the Rust Language	2021-04-10 22:34:00	\\	<p>I previously mentioned in my WebAssembly post that I am particularly excited for WebAssembly and the benefits it introduces to applications running in the browser. During my exploration of WebAssembly I often come across a relevatively new programming language, Rust. Now I don't believe in seeking out learning any more lanaguages than you have to. In my limited experience, the skills you learnt programming in one langauge are easily transferable to another langauage and usually are just syntax changes. There are of course exceptions to this, for instance memory management between C++ and Java are substantial but concepts such as arrays and string manipulation do not change.</p>\n<p>Why then write about Rust? As you might have guessed, I would every much like to pursue a career working closely with both hardware and software. Sofware tuned for the hardware on which it runs requires a langauge that allows for fine grained control. It is for this reason C/C++ dominates the IoT space. However also consider the current need for more parallel computing and the concurrency considerations that come along with that. C++ is hard and the nature of parallel computing makes it even more so, but perhaps it doesn't need to be. Rust promises to provide the same level of control whilst still protecting you concurrency issues. It does this by not allowing you to compile unsafe code. And finally just know that Rust seems to be showing up everywhere! From Linux kernals to Web Apps. Even some Blockchain technologies are being developed or ported to Rust.</p>\n<p>So with all those considerations in mind I decided to try learn Rust despite it not being immediately apparent when or where it would be useful to me specifically.</p>\n<p>Getting started, I began checking out theie main homepage. They have a really comprehensive manual. Here is a collection of language specific features I learnt.</p>\n<h2 id="variables">Variables</h2>\n<p>I generally always had a preference for strongly typed languages. I prefer being able to look at a variable declaration and being able to know straight away whta the data type being stored is. Rust decided to follow in the likes of Python or Javascript and elected to have the compiler figure out the data type of the variable during compilation. I began softening up to the idea of not explicitly decalring types when I watched a Youtube video explaining that doing so is actually quite redundant. Looking at the example below, shouldn't it be obvious that the variable is a string and not have to say so?</p>\n<pre><code>string var = &quot;This is a string&quot;;</code></pre>\n<p>Mutable means to change. By default variables declared are treated as immutable. This immediately made me think of constants in other langauages. To the best of my knowledeg however Rust makes a disctinction between immutable variables and constants by requiring constants to have a data type explicitly declared for a constant. However we usually want to change variable values and thus to allow this we must append the 'mut' keyword.</p>\n<h2 id="ownership">Ownership</h2>\n<p>The handbook labels this as the key feature of the Rust language. Before I continued I needed a quick refresher in the stack and heap. From my varisty C++ notes, local variables and arguments gets allocated a space in the stack memory. As soon as it is no longer needed, that memory get automatically deallocated. Dynamic variables and objects get allocated to heap memory (look out whenever the &quot;new&quot; keyword is used). A dynamic variable has it's address space determined at runtime and not compile time. The Rust manual adds that we use heap memory when the size of the object being stored is only known at runtime or the memory will change throughout the programme. We use pointers to store the address of a dynamic variable in order to use them. Furthermore it requires the programmer to be responsible to free up memory on the heap. However, some languages like Java alleviates this burden by doing automatic &quot;garabage collection.&quot;</p>\n<p>Rust takes a different approach to managing heap memory by introducing ownership rules. Consider the mutable string below. The size and memory of the string can change throughout the programme and so will be stored in the heap.</p>\n<pre><code>let mut s1 = String::from(&quot;Hello&quot;);</code></pre>\n<p>Every value is stored in a variable known as the owner. There is only one owner at a time and when the owner goes out of scope the value get deleted. The concept of ownership becomes apparent when considering the following:</p>\n<pre><code>let s1 = String::from(&quot;hello&quot;);\nlet s2 = s1;</code></pre>\n<p>Typically we'd expect the second line of code to result in a shallow copy. However Rust invalidates s1 and can't be used later. This is not a shallow copy but referred to as a move. This move is also true when passing variables to functions. When the function ends you'd want to return the value in order to still continue using this. This of course is a limitation and is addressed by using references, indicated with a &amp;. Since a reference does not own the value being passed, it cannot modify it unless the mut keyword is also included.</p>\n<pre><code>fn main(){\n    let s1 = String::from(&quot;hello&quot;);\n    my_method(&amp;mut s1);\n    // Carry on using s1 which now stores &quot;hello some other stuff&quot;\n}\n\nfn my_method(my_string : &amp;mut String){\n    my_string.push(&quot; some other stuff&quot;);\n}</code></pre>\n<p>Briefly note that deep copies of heap memory are done with the clone() method.</p>\n<h2 id="cargo">Cargo</h2>\n<p>One of the benefits of lanaguages such as Python, Javascript, C# (.NET) etc. are the ability to easily include external packages and libraries. A friend of mine said Rust is C with a package manager.</p>\n<h2 id="concurrency">Concurrency</h2>\n<h2 id="next-steps">Next steps</h2>\n<p>I just summarized some of the interesting aspects about Rust I observed in my attempt to learn the new language. Naturally I believe the best way to actually learn the language is to practise it by writing up some random app. I hope to write something I created in Rust later on. I'm thinking something along the lines of a Directed Acyclic Graph to understand an interesting decentralised framework called IOTA. They too are creating a some sort of Rust API.</p>\n	https://commons.wikimedia.org/wiki/File:Rust_programming_language_black_logo.svg
6	Glossary of Web Terminology	2021-06-10 00:00:00	\\	<h2 id="archictecture">Archictecture</h2>\n<ul>\n<li>Entity</li>\n</ul>\n<p>Entities as the relate to N-Tier server side applications are just classes which model useful objects we need to work with in our &quot;business&quot; logic.</p>\n<ul>\n<li>Mircoservices</li>\n</ul>\n<p>A microservice is a Web Design architecture. Benefits to compartmentalising specific tasks into microservices includes having functionality from multiple programming languages, robustness as a scalability</p>\n<ul>\n<li>End-Point</li>\n</ul>\n<p>The front side application needs to communicate with the backend. This is done by exposing end-points. End-points are URLs that match to specific functions in the backend server. For instance the Client can make a URL request which will call the following backend method to be executed. ASP.NET does this by appending some attribute above the controller method definition.</p>\n<pre><code>[HttpGet(&#39;/api/get_something&#39;)]\npublic int get_something()\n{\n    // Return some value\n}\n</code></pre>\n<ul>\n<li><p>Middleware</p></li>\n<li><p>CORS</p></li>\n</ul>\n<p>Cross Origin Resource Sharing is the most frequent error I see as a junior web developer. It refers to sharing any resources that exisit outside the web application. For example if I try write code to read a file that exists outside my Angular application, a CORS issue would arise. Although painful at times, it is easy to see the security reasons behind preventing this.</p>\n<ul>\n<li>Reverse Proxy</li>\n</ul>\n<p>So a web server is pretty simple to understand. I'd would simplify it's function to recieving HTTP requests and then mapping it some some function in the application. A reverse proxy it seems is another component which sits between the web server and the client. Being positioned here the reverse proxy is able to do useful things like compressing the data or being a second line of defense before content reaches the application. A reverse proxy can also cache some web pages which offloads some work from the web server as well as offering a better experiance for the user. Examples of reverse proxies include NGINX and Apache HTTP.</p>\n<ul>\n<li>Websocket</li>\n</ul>\n<h2 id="web-tools-technologies">Web Tools / Technologies</h2>\n<ul>\n<li>Nginx</li>\n</ul>\n<p>A reverse proxy that sits between the web server and the client who is sitting on the Internet.</p>\n<ul>\n<li>Signalr</li>\n</ul>\n<p>ASP.NET library that will push server side data to clients automatically. The client doesn't need to request the data first. This would be useful for scenarios which require real-world updates like a server serving updates for a sports event.</p>\n<ul>\n<li>Swagger</li>\n</ul>\n<p>An application which allows you to quickly test end-points. Really useful when you don't want to fire up the whole client side application to do so.</p>\n	https://unsplash.com/photos/DX9X0g0Cg88
7	A Decentralized Web	2021-07-31 00:00:00	\\	<p>IPFS hopes to build a decentralized web. This web will not have to rely on the central servers provided by large companies but instead the web will be shared between the millions of devices that use the internet everyday.</p>\n<h2 id="primer-into-how-ipfs-works">Primer into how IPFS works</h2>\n<p>Storing all the web's content in a decentralised manner will require a fancy and efficient data structure. Whenever the word &quot;decentralised&quot; is mentioned everyone thinks blockchain, and understandablly so. However dentralisation can be achieved without the blockchain and it is useful to think of the blockchain as just a secure data strucutre. IPFS uses a Merkel Directed Acyclic Graph (DAG). This is actually a commonly used data strucutre and is ideal for storing file structures. The cryptocurrency IOTA also uses a DAG and hopefully will be something I investigate in the future.</p>\n<h2 id="getting-started-with-ipfs">Getting Started with IPFS</h2>\n<p>Install the IPFS command line interface and run:</p>\n<pre><code>ipfs init</code></pre>\n<p>This will create a .ipfs directory in your home directory which will store all the keys. We can now take our device online by running:</p>\n<pre><code>ipfs daemon</code></pre>\n<p>The daemon runs in its own instance of the terminal and will stop when terminal is closed. To test we are connected to the merkle DAG we can print the content of this quick start text file by running the following in another terminal instance:</p>\n<pre><code>ipfs cat /ipfs/QmYwAPJzv5CZsnA625s3Xf2nemtYgPpHdWEz79ojWnPbdG/quick-start</code></pre>\n<p>Now we are used to interacting with the web through the browser. Unfortunately the browser only knows how to speak HTTP, centralised protocol. If we want to access content on the IPFS network we need the browser to speak IPFS. Right now, this can be acheived by downloading the IPFS Companion plugin but perhaps in the future this will supported natively.</p>\n<h2 id="creating-a-single-page-website">Creating a single page website</h2>\n<p>A single page website (or any other single file content such as an image, song or video) is really easy to host on the IPFS network. It is just a matter of uploading the files. There is a command line way of doing the following but I found it is more intuitive to use the webui provided by the IPFS daemon. To access the UI just navigate to https://localhost:5001 in the browser. Once you have uploaded your file you can get a &quot;share&quot; link which anyone can use to navigate your resource. Remeber they would need IPFS running as well as the IPFS Companion plugin for the browser.</p>\n<h2 id="creating-a-more-complicated-static-websites">Creating a more complicated static websites</h2>\n<p>Single page static websites aren't exactly super exciting. What is exciting is to see if IPFS could support more widely adopted web frameworks like Angular. I am still going to try keep it simple by having the Angular website still just serving static content. No backend just yet. Following steps can be found from this <a href="https://medium.com/gochain/how-to-deploy-an-unstoppable-angular-app-to-ipfs-c2dabb52e517">tutorial</a>.</p>\n<p>Basic startup:</p>\n<pre><code>ng new IPFS-Webapp --skip-install # Create new project\nyarn install # Use yarn to manage dependancies \nnpm start # Start the project to see if it works</code></pre>\n<p>Remember IPFS and HTTP are different protocols and hence the URL structure is different. As such the base URL of the Angular project (defined base tag in src/index.html) must be changes to:</p>\n<pre><code>&lt;script&gt;\n     document.write(&#39;&lt;base href=&quot;&#39;+window.location.pathname+&#39;&quot;/&gt;&#39;);\n&lt;/script&gt;</code></pre>\n<p>That is it! We can now build a publishable version of the project by running:</p>\n<pre><code>ng build --prod</code></pre>\n<p>The publishable version of the Angular project can be found in the 'dist' folder. It is this folder which will upload to the IPFS using either the web UI or command line.</p>\n<pre><code>ipfs add -r dist/IPFS-Webapp</code></pre>\n<p>Done! We can get the sharable link and view the project with a browser that has IPFS Companion installed.</p>\n<h2 id="next-steps">Next Steps</h2>\n<p>Now with a basic static page up it is worth looking at how IPFS and RESTful APIs interact. Other technologies include OrbitDB, a decentralized database. The question remains if we can host truly dynamic and smart web apps on a decentralized network.</p>\n	https://upload.wikimedia.org/wikipedia/commons/thumb/1/18/Ipfs-logo-1024-ice-text.png/240px-Ipfs-logo-1024-ice-text.png
8	Adding SwaggerUI to ASP.NET Core	2021-07-31 00:00:00	\\	<p>The basic architecture for the current web is as follows:</p>\n<ol style="list-style-type: decimal">\n<li>A client (user) downloads a front side app to their browser. Typically this client code is limited to displaying what the user sees on screen and performing any tasks that do need access to company servers.</li>\n<li>Sensitive user and company data is typically stored on the companies servers. This of course is for control and security reasons.</li>\n<li>Naturally the client will need to access and add to this data at some point. To do access this data the client must communicate to the backend through HTTP requests</li>\n</ol>\n<p>Companies therefore must write backend applications which must know how to handle the requests the client makes. The front end must interface with the company backend through an Application Specific Interface (API). Obviously the developers building the backend should document and test this API so the front end developers know what methods to call and how to use them. This is where SwaggerUI is useful. It provides a simple interface to view the API, see what objects each method takes and returns. It also offers the ability to test the methods themselves by allowing you to execute the methods without having to write any front end code.</p>\n<h2 id="add-swagger-to-asp.net-core-project">Add Swagger to ASP.NET Core Project</h2>\n<ol style="list-style-type: decimal">\n<li><p>Create new project</p>\n<pre><code>dotnet new webapp -o MySwaggerProject</code></pre></li>\n<li><p>Add required packages</p>\n<pre><code>dotnet add package Swashbuckle.AspNetCore</code></pre></li>\n<li><p>Include library in Startup.cs</p>\n<pre><code>using Microsoft.OpenApi.Models;</code></pre></li>\n<li><p>Add to services in Startup.cs</p>\n<pre><code>services.AddSwaggerGen();</code></pre></li>\n<li><p>Configure app</p>\n<pre><code>app.UseSwagger();\napp.UseSwaggerUI(c =&gt; {\nc.SwaggerEndpoint(&quot;/swagger/v1/swagger.json&quot;, &quot;My API V2&quot;);\n});</code></pre></li>\n<li><p>Done! Just run the app</p>\n<pre><code>dotnet run</code></pre></li>\n</ol>\n<p>Finally you can access Swagger UI from the following URL</p>\n<pre><code>https://&lt;app url&gt;/swagger</code></pre>\n	https://upload.wikimedia.org/wikipedia/commons/a/ab/Swagger-logo.png
9	Working with ORM, Database Migrations and Repository Patterns	2021-09-09 00:00:00	\\	<p>Object Orientated Programmers think in terms of objects. The objects are defined by classes which contain properties associated with the object.</p>\n<p>Relational Databases think in terms of tables of records. Each record has fields associated with that record.</p>\n<p>Business applications require both relational databases to store the data as well as being able to convert that data to objects so that the developers can use them accordingly. Here enters a Object Relational Mapper (ORM) tool which does exactly as the name suggests; map objects to relational records and vice versa. This tool hence can significantly simplify the life of the developers.</p>\n<p>Here I will outline the basic procedure to get Microsofts EntityFramework Core (the open source version of the arguably most popular ORM tool: EntityFramework). We will be using a PostgreSQL database and so will use the PostgreSQL version of the tool.</p>\n<ol style="list-style-type: decimal">\n<li>Download the EntityFramework Core tool</li>\n</ol>\n<p>dotnet tool install --global dotnet-ef</p>\n<ol style="list-style-type: decimal">\n<li>Begin a dotnet core project</li>\n</ol>\n<p>dotnet new console</p>\n<ol start="2" style="list-style-type: decimal">\n<li>Add package to the project</li>\n</ol>\n<p>dotnet add package Npgsql.EntityFrameworkCore.PostgreSQL --version 5.0.7</p>\n<ol start="3" style="list-style-type: decimal">\n<li>Define entities. (An object which will have an associated table in database)</li>\n</ol>\n<p>public class Blogs { public int BlogId { get; set; } public string Url { get; set; } }</p>\n<ol start="4" style="list-style-type: decimal">\n<li>Define DB context and add entities to DB context</li>\n</ol>\n<p>public class BloggingContext : DbContext { public DbSet<Blog> Blogs { get; set; }</p>\n<pre><code>    protected override void OnConfiguring(DbContextOptionsBuilder optionsBuilder)\n        =&gt; optionsBuilder.UseNpgsql(&quot;Host=my_host;Database=my_db;Username=my_user;Password=my_pw&quot;);\n}</code></pre>\n<ol start="5" style="list-style-type: decimal">\n<li><p>Add DB context to services (if building ASP.NET Core application) public void ConfigureServices(IServiceCollection services) { services.AddDbContext<BloggingContext>(options =&gt; options.UseNpgsql(Configuration.GetConnectionString(&quot;BloggingContext&quot;))); }</p></li>\n<li><p>Add your first migration. Now migrations are interesting. They are like version control for databases. Say you want to add a new column to a database, you would first create a migration with this change. The migration not only holds the code to update the database with your new column but also holds the code to roll back the database before the change was made; just in case something breaks.</p></li>\n</ol>\n<p>dotnet ef migrations add <Name of Migration></p>\n<ol start="7" style="list-style-type: decimal">\n<li>The migration is just the snapshot of the changes we want to make. We must now update the database to reflect these changes</li>\n</ol>\n<p>dotnet ef database update</p>\n<ol start="8" style="list-style-type: decimal">\n<li>If all goes well you can check your database to see if the changes were applied correctly</li>\n</ol>\n<p>Great! We built a relational database from code (Code First). However, the entity created has no relationship with any other entity. In relational database design there are three types of relationships between entities (tables). They are defined as follows:</p>\n<ul>\n<li>One to One</li>\n<li>One to Many</li>\n<li>Many to Many</li>\n</ul>\n<ol style="list-style-type: decimal">\n<li>Example for one to one</li>\n</ol>\n<p>Public class EntityA { Public int id { get; set; } Public string name { get; set; } } Public class EntityB { Public int id { get; set; } Public string name { get; set; } }</p>\n<ol start="2" style="list-style-type: decimal">\n<li>Example for one to many</li>\n</ol>\n<p>Public class EntityA { Public int id { get; set; } Public string name { get; set; } } Public class EntityB { Public int id { get; set; } Public string name { get; set; } Public IList<EntityA> CollectionOfEntities { get; set; } }</p>\n<ol start="3" style="list-style-type: decimal">\n<li>Example of Many to Many. Note: EntityFramework Core does not support this relationship out of the box. Instead we can get around this by creating 2 one to many relationships in both ways. Furthermore an intermediary entity will need to be created to represent the joining table required for a many to many relationship.</li>\n</ol>\n<p>Public class EntityA { Public int id { get; set; } Public string name { get; set; } Public IList<EntityAEntityB> CollectionOfEntitiesB { get; set; } }</p>\n<p>Public class EntityB { Public int id { get; set; } Public string name { get; set; } Public IList<EntityAEntityB> CollectionOfEntitiesA { get; set; } }</p>\n<p>Public class EntityAEntityB {</p>\n<p>}</p>\n<p>Now how do I interact with the database, like fet ching or adding records? Let me first discuss repository patterns.</p>\n<p>Repository patterns are just a standardized way to interact with persistent storage. It follows the Domain Driven Design pattern for building software. Briefly DDD splits a large project into layers, whereby each layer is responsible for a single concern. Typical layers include:</p>\n<ul>\n<li>Core layer for modelling entities and business logic</li>\n<li>EntityFramework layer handles migrations and DBContext</li>\n<li>Application layer where our controllers are defined</li>\n<li>Presentation layer handles how the data is presented to the user</li>\n</ul>\n<p>It should be noted you definitely can interact directly with the database just with the DBContext but this is not best practise with enterprise applications. You would rather have a layer that sits between you and the actual database access so that when you are interacting with the database you do not need to worry about implementing the connection to the database each time.</p>\n<p>The steps to build a repository are as follows:</p>\n<ol style="list-style-type: decimal">\n<li>Implement a IRepository interface. Typical methods we want to define are Get, GetAll, Update etc. Good practise to define a structure for the repository before implementing it</li>\n<li>Create an abstract Repository class which implements these methods.</li>\n<li>Create Repository that inherits from abstract repository class</li>\n<li>Use repository as a dependency injection into your application</li>\n</ol>\n<p>What are dependency injections? This is a technique whereby a class requests certain dependencies (other objects) without needing to create and manage these</p>\n<p>Dependency Injections create and manage dependencies requested by another object thus removing the requesting objects responsibility of managing those dependencies themselves. We can realise dependency injections using a dependency injection framework like Caste Windsor.</p>\n	\N
10	Microblaze Softcore on Arty A7	2021-09-09 00:00:00	\\	<p>At the beginning of the year I bought an Arty 35T FPGA board. After some initial projects</p>\n<p>I wanted to run through an example of using my FPGA as a processor to run Linux. Basically convert the FPGA board into something more equivalent to a Raspberry Pi. I think this exercise will be a good refresher into FPGA design and the design flow with Vivado. I found this tutorial to work through. It is very thorough and easy to follow. The purpose of this post isnt to restate the steps given but just for me to expand on specific concepts with FPGAs.</p>\n<p>https://projects.digilentinc.com/whitney-knitter/hello-microblaze-on-arty-a7-70d9e1</p>\n<p>Firstly note FPGAs are not microprocessors. Instead they are made up of interconnected logic gates which can then be configured into any digital logic circuit you desire. Why do we care for digital logic design? For one we can design circuits which perform computation at lightning speed, much faster than software. It is apparent a chip dedicated to a specific task will be much faster than software running on a processor that also has to deal with other overhead.</p>\n<p>But also remember, a processor is also just a digital circuit (granted it is a highly complex digital circuit) it can be programmed on a FPGA. The designs for such processors are readily available and are referred to as soft cores. FPGAs are large and can typically house a soft processor with room left over for other designs too. This offers the best of both worlds as the designer can use the softcore for the general purpose tasks as well as have dedicated hardware for when speed really matters.</p>\n<p>The softcore design Ill be using is called MicroBlaze. This software is capable of running a custom PetaLinux distribution or running standalone C/C++ applications directly.</p>\n<ol style="list-style-type: decimal">\n<li>Create a new project with the correct board files</li>\n<li>First we start with a Block Design in Vivado. For simplicity logic circuits can be represented as blocks with inputs and outputs. There are many logic designs for many different purposes. The designers of these designs share their work as IP Cores (i.e. blocks that we can include in our projects).</li>\n<li>Drag a MicroBlaze IP Core onto the block design</li>\n<li>The most basic digital logic block is an individual logic gate. We can add such blocks using the Utility Vector Logic cores. It goes without saying we probably dont want to create a whole design using only these. ;)</li>\n<li>Ad the UART1655 IP core which will handle the serial interface between the host computer and the FPGA board</li>\n<li>We can also add a GPIO controller allowing the softcore processor (Microblaze) to interface with the GPIO of the board.</li>\n<li>Validate the design</li>\n<li>Create an HDL wrapper. An HDL wrapper as I understand it is a VHDL (or Verilog) top level entity to the whole design. It is the block where we define the inputs and outputs will physically map to the IO pins of the FPGA.</li>\n<li>The actual mapping between these defined pins and the actual pins is done using a constraints file. Board manufacturers typically provide one for convenience. We just need to make sure the names of our inputs and outputs match what is defined in the constraints file.</li>\n<li>Let me now briefly introduce the FPGA design flow. After we have a written up a design, we must run the synthesis tool which converts the design to a gate-level logic (i.e. can this design be realised by the using logic gates). The next step is implementation which optimizes the synthesized design and does place and route. Finally we have bitstream generation. The bitstream is the binary file that will be loaded to configure the FPGA.</li>\n<li>It is important to note that when we add a softcore to our hardware design, that we would therefore also need to write software for that softcore. This is why Xilinx Vivado (the tool I primarily use for now) includes an SDK to write C/C++ code for the FPGA.</li>\n<li>Before we can begin writing software for the Microblaze, we must export the hardware definition (specification) files, so that the software we write knows how to run on the hardware we designed. These files would obviously include the bitstream from our hardware design. The hardware specification also includes a description of the hardware such as which IP cores are present and the register information for those cores.<br />\n</li>\n<li>The hardware specification files will exist as a single folder in our application. We can now add an Application Project to the project</li>\n<li>There are two types of Application Projects, namely; Standalone and Linux. There is also an option for an RTOS application but that is beyond the scope for now.</li>\n<li>Standalone: Applications that run completely on their own without Linux operating system</li>\n<li>Linux: Processor runs with a Linux operating system (e.g. Petalinux) and application runs within the OS</li>\n<li>When creating the Application Project there is also an option to generate the Board Support Package which will be built from our hardware specification. The BSP is the lowest layer of the software stack and includes the drivers required to interact with the hardware.</li>\n<li>You will need a serial terminal to interact with your device.</li>\n</ol>\n	\N
11	Docker for Development	2021-09-09 00:00:00	\\	<p>Often when exploring various open source projects, you often see near the end of the README that there is a Docker image provided. Compiling software yourself is often a lot of fun but you often run into problems such as not having the correct dependencies or forgetting important steps because you dont want to read the documentation too carefully. Sometimes you dont want this hassel and if you do, the developers graciously provide a pre-built docker image with all the required dependencies so you can just run the tool.</p>\n<p>This is great but then how do I actually use this container? This is the question I found myself asking after wanting to try out GHDL, a compiler and simulation tool for VHDL. At first I thought you could run the container iteratively and this would give you terminal access into the container but remember these containers are barebones. They dont have your favourite text editors and/or other tools included. And more importantly storage within the container is not persistent, meaning that once the container stops all the data within is also lost.</p>\n<p>With that in mind, here I document a development flow with a GHDL docker container using Docker mounts. Obviously we can get started by first pulling the docker image we want to work with. This step is actually optional since Docker will automatically pull the image if it cant find it locally when running the following commands later.</p>\n<p>docker pull ghdl/ghdl</p>\n<p>docker run -it --rm -v $PWD:/work -w /work ghdl/ghdl {command} {arguments}</p>\n<p>-it : Run the container interactively. This will allow us to see the output of the container --rm : Remove the container once it is done running -v : Mount the current working directory to a folder /work in the container -w : Change the working directory of the container to /work Remember this is where we copied all our files to</p>\n<p>After the container has run the command, the resulting output files in the same directory as your mounted volume.</p>\n	\N
